SELECT `County`, `English name`, `Irish name`, `Population`, `Irish speakers`
   FROM `table_1_101196_1`
   WHERE `Irish speakers` > 50
   ORDER BY `Population` DESC;
   ORDER BY `Irish speakers` DESC;

